function runCustomScript() {
    // <li><div style="margin-left:50px;padding-top:19.5px;padding-bottom:19.5px;"><input id="searchInput" type="text" placeholder="输入关键字查找" ></input></div></li>
    let topContainer = $("#md-main-navbar .collapse .navbar-right")[0];

    if (!topContainer) {
        setTimeout(() => {
            runCustomScript();
        }, 500);
        return;
    }

    let div = document.createElement("div");
    // div.className = "nav navbar-nav navbar-right";
    Object.assign(div.style, {
        "padding-top": "15px",
        "margin-right": "10px",
        // width: "200px",
    });
    topContainer.append(div);

    let lang = document.createElement("a");
    let isEn = window.location.pathname.includes("/en/");
    if (isEn) {
        lang.innerText = "中文版";
        lang.href = window.location.href.replace("/en/", "/wiki/");
    } else {
        lang.innerText = "EN";
        lang.href = window.location.href.replace("/wiki/", "/en/");
    }
    Object.assign(lang.style, {
        width: "90px",
        display: "inline-block",
        color: "#FFF",
    });
    div.append(lang);

    let input = document.createElement("input");
    input.id = "searchInput";
    input.type = "text";

    Object.assign(input.style, {
        width: "250px",
        display: "inline-block",
    });
    input.placeholder = "Search...";
    div.appendChild(input);

    input.onchange = (v) => {
        console.log(v);
    };

    // div.innerHTML = `<input id="searchInput" type="text" placeholder="输入关键字查找" ></input>`;

    {
        let interval = setInterval(() => {
            if (typeof $("#searchInput").autocomplete == "function") {
                clearInterval(interval);
                $("#searchInput").autocomplete({
                    source: PAGE_LIST,
                    appendTo: "#md-main-navbar",
                    select: function (event, ui) {
                        // console.log(event, ui);
                        let { label, value, path } = ui.item;
                        console.log(ui);
                        window.location.hash = `!${path}`;
                    },
                });
                $(".ui-autocomplete");
            }
        }, 100);
    }

    // addCommentSystem();
}

function addCommentSystem() {
    let div = document.createElement("div");
    div.innerHTML = "<hr><i>Loading...</i>";
    div.className = "container";
    div.style["margin-top"] = "30px";
    document.getElementById("md-body").appendChild(div);

    let script = document.createElement("script");
    // script.src = "https://utteranc.es/client.js";
    script.setAttribute("src", "https://utteranc.es/client.js");
    script.setAttribute("repo", "crazyjunichi/card-survival-wiki");
    script.setAttribute("issue-term", location.hash.substring(2, location.hash.indexOf(".")));
    script.setAttribute("label", "comment");
    script.setAttribute("theme", "boxy-light");
    script.setAttribute("crossorigin", "anonymous");
    script.setAttribute("async", "true");
    document.getElementById("md-body").appendChild(script);

    {
        let interval = setInterval(() => {
            if ($(".utterances")[0] && $(".utterances")[0].style && $(".utterances")[0].style.height) {
                clearInterval(interval);
                div.remove();
                // console.log("done");
            }
        }, 100);
    }
}

$(function () {
    runCustomScript();
});

